import React from "react";
function Education() {
  return (  
   <div className="container ">
    <div className="row">
      <div className="col-6">
        <img src="media/images/education.svg" alt="Education" />
      </div>
      <div className="col-6">
        <h>Free and open market education</h>
        <p>Varsity, the largest online stock market education book in the world covering everything from the basics to advanced trading.</p>
        <a href="#" className="text-decoration-none text-primary fw-semibold mb-3">
              Varsity <i className="fa fa-long-arrow-right" aria-hidden="true"></i>
            </a>
          
      </div>
    </div>
   </div>
  );
}

export default Education;
